import "./App.css";
import React from "react";
import Header from "./Header.js";
import { Route, Routes, Router } from "react";
function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" component={<Header />}></Route>
      </Routes>
    </Router>
  );
}

export default App;
